import React from 'react';
import backgroundImage from './assets/joe-woods-4Zaq5xY5M_c-unsplash.jpg'; // Import image from src/assets

const App = () => {
  return (
    <div
      className=" bg-cover bg-center bg-no-repeat bg-fixed h-screen overflow-hidden flex justify-center "
    //   style={{ backgroundImage: `url(${backgroundImage})` }}
    >
      <h1 className="text-black text-3xl shadow-2xl font-bold bg-white h-16 flex items-center justify-center mt-6 w-[90vw] rounded-2xl">Random GIFS</h1>
    </div>
  );
};

export default App;
